import React, { useEffect, useState } from 'react';
import axios from 'axios';

function PapusiFete() {
  const [fruits, setFruits] = useState([]);

  useEffect(() => {
    // Fetch items from the API endpoint
    axios.get('/api/fete')
      .then((response) => {
        setFruits(response.data);
      })
      .catch((error) => {
        console.error('Error fetching items:', error);
      });
  }, []);

  return (
    <div>
        <h1>Fruits</h1>
        {Array.isArray(fruits) && fruits.length > 0 ? (
          <ul>
            {fruits.map((fruit) => (
              <li key={fruit._id}>
                <h2>{fruit.name}</h2>
                {/* <p>{fruit.review}</p>
                <p>{fruit.score}</p> */}
              </li>
            ))}
          </ul>
        ) : (
          <p>Loading fruits...</p>
        )}
      </div>
  );
}

export default PapusiFete;
